function Formulario(){
    return (
       <div>
            <form>
                <p>Nome</p>
                <input type="text" name="name" placeholder="Nome" />
                <p>Telefone</p>
                <input type="number" name="telefone" placeholder="Telefone" />
                <p>Egresso/Convidado</p>
                <input type="checkbox" />
                <input type="submit" value="Enviar" />
            </form>
       </div> 
    )
}


export default Formulario;
